import logo_main from './log_logo.jpg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header style={{
        backgroundColor: '#432910',
        height: '3vh', // Adjust this value to make the bar smaller or larger
        width: '100%'
      }}>
      </header>

        <div>
          <img src={logo_main} width="30%" alt="Main Logo" class="mainClass"/>
          <h1 class="textMainClass">We sell wood or something</h1>
        </div>
    </div>
  );
}

export default App;
